  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:00.936398\",\n\t\"name\": \"fort-peck-game-range-narrative-report-january-april-1959\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Peck NWR
  and the easement refuges outlines Refuge accomplishments from January through April
  of 1959. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and collections and receipts. Resource
  management is outlined; topics include fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, and Refuge participation.
  Items of interest and N-R forms are attached.\",\n\t\"license_title\": \"License
